import React from "react";
import "../../../Styles/Pages/Blog/BlogLinks.scss";

function BlogLinks() {
  return (
    <div className='blogLinks'>
      <ul>
        <li>All posts</li>
        <li>Ecommerce</li>
        <li>Announcments</li>
        <li>Payments</li>
        <li>Technology</li>
        <li>Product</li>
      </ul>
    </div>
  );
}

export default BlogLinks;
